import React from 'react';
import { FaEnvelope, FaTwitter, FaLinkedin, FaInstagram } from 'react-icons/fa';

const Contact = () => {
  return (
    <div className="contact-container">
      <h1>Get in touch</h1>
      <p>If you have any questions, feel free to reach out.</p>
      <p>We do our best to reply within 48 hours.</p>

      <div className="contact-info">
        <FaEnvelope className="contact-icon" />
        <p>Email: <a href="mailto:support@linkdrip.com">support@linkdrip.com</a></p>
      </div>

      <div className="social-media">
        <h2>Follow us on social media</h2>
        <div className="social-icons">
          <a href="#" aria-label="Twitter"><FaTwitter /></a>
          <a href="#" aria-label="LinkedIn"><FaLinkedin /></a>
          <a href="#" aria-label="Instagram"><FaInstagram /></a>
        </div>
      </div>

      <form className="contact-form">
        <input type="text" placeholder="Name" required />
        <input type="email" placeholder="Email" required />
        <textarea placeholder="Leave us a message" required></textarea>
        <button type="submit">Send Message</button>
      </form>
    </div>
  );
};

export default Contact;
